import React from 'react'
export default function AfficheFill(props){
    const ListeModels=["Models11","Models12","Models13","Models14"]
    return(
        <div>
            <h3>Filliers : </h3>
            <div>Code Filliers:{props.filliers[0].codeF} -nom de filliers:{props.filliers[0].nomF}</div>
            <div>
                <h3>liste des Models</h3>
                {ListeModels.map((e)=>{
                   return <span>{ e }</span>
            })}</div>
        </div>
    )
}
